import React, { useState } from 'react'
import Editor from 'for-editor';

const NewPost = () => {
    const [markdown, setMarkdown] = useState()

    const handleChange = (value) => {
        setMarkdown(value)
    }
    return (
        <div>
            <Editor value={markdown} onChange={
                e => { handleChange() }
            } />
        </div>
    )
}

export default NewPost
